import React, { Component } from "react";
import { Route, Redirect } from "react-router-dom";

const Auth = ({ path, Component }) => {
   return <Route
    path={path}
    render={routerProps => {
      if (localStorage.getItem("userLogin")) {
        return <Component {...routerProps} />;
      }
     
      return <Redirect to="/" />;
    }}
  />;
};

export default Auth;
